    //put pup data into our backpack
    //may need to define single pup for mapping through all the puppies
    const {pupData} = props;

    return(
    //copied the html from renderHelpers for a single card and edited how sean did in lecture
    <div className="single-player-view">
        <div className="header-info">
          <p className="pup-title">{pupData[0].name}</p>
          <p clasNames="pup-number">#{pupData[0].id}</p>
        </div>
        <p>Team: {pupData[0].team ? pupData[0].team.name : 'Unassigned'}</p>
        <p>Breed: {pupData[0].breed}</p>
        <img src="pupData.imageUrl"/>
        <button id="see-all">Back to all players</button>
      </div>







